<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Two Column Layout with Scroll Animations</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Arial', sans-serif;
            line-height: 1.6;
            color: #333;
            overflow-x: hidden;
        }

        .container {
            max-width: 1200px;
            margin: 0 auto;
            padding: 20px;
        }

        /* Snap-wrapper: disable as scroll viewport; use .content-container instead */
        .snap-wrapper {
            height: auto;
            overflow: visible;
        }
        .snap-wrapper > .container { height: auto; }
        /* Inside snap-wrapper, let wrapper control paging; prevent inner scroll */
        .snap-wrapper .content-container { height: 100vh; overflow-y: auto; }

        /* Scrollable section container (desktop) */
        .content-container {
            height: 100vh;            /* view-height viewport */
            overflow-y: auto;         /* vertical scroll inside (overridden in snap-wrapper) */
            position: relative;
            padding: 0;
            overscroll-behavior: contain; /* reduce scroll chaining/bounce to outer */
        }

        /* Hide scrollbars but keep scrolling (cross-browser) */
        .content-container {
            -ms-overflow-style: none;      /* IE 10+ */
            scrollbar-width: none;         /* Firefox */
        }
        .content-container::-webkit-scrollbar { /* Chrome/Safari */
            display: none;
            width: 0;
            height: 0;
            background: transparent;
        }

        /* Also apply to two-column-layout in case it becomes scrollable */
        .two-column-layout {
            -ms-overflow-style: none;
            scrollbar-width: none;
        }
        .two-column-layout::-webkit-scrollbar {
            display: none;
            width: 0;
            height: 0;
            background: transparent;
        }

        .two-column-layout {
            display: flex;
            gap: 40px;
            align-items: flex-start;
        }

        /* Make the inner layout taller to drive scroll (desktop) */
        .content-container .two-column-layout {
            height: 400vh;
            position: relative;
        }

        /* Visually hidden but focusable skip link */
        .skip-link:focus {
            position: static !important;
            width: auto !important;
            height: auto !important;
            padding: 8px 12px;
            background: #000;
            color: #fff;
            z-index: 10000;
        }

        .text-column {
            flex: 1;
            position: relative;
        }

        /* Sticky text column in the scrollable section (desktop) */
        .content-container .text-column {
            position: sticky;
            top: 0;
            height: 100vh;
        }

        .text-section {
            height: 100vh;
            padding: 40px 20px;
            background: linear-gradient(135deg, #f5f7fa 0%, #c3cfe2 100%);
            border-radius: 15px;
            box-shadow: 0 10px 30px rgba(0, 0, 0, 0.1);
            margin-bottom: 20px;
            display: flex;
            flex-direction: column;
            justify-content: center;
            position: relative;
            overflow: hidden;
        }

        .svg-column {
            flex: 1;
            position: sticky;
            top: 20px;
            height: calc(100vh - 40px);
            display: flex;
            align-items: center;
            justify-content: center;
            padding: 40px 20px;
            border-radius: 15px;
            box-shadow: 0 10px 30px rgba(0, 0, 0, 0.1);
        }

        /* Normalize sticky SVG column within the scrollable section (desktop) */
        .content-container .svg-column {
            top: 0;
            height: 100vh;
        }

        .text-content {
            max-width: 100%;
        }
        
        .text-content h1 {
            font-size: 2.5rem;
            margin-bottom: 20px;
            color: #2c3e50;
            font-weight: 700;
        }

        .text-content h2 {
            font-size: 1.8rem;
            margin: 30px 0 15px 0;
            color: #34495e;
            font-weight: 600;
        }

        .text-content p {
            font-size: 1.1rem;
            margin-bottom: 20px;
            color: #555;
            line-height: 1.8;
        }

        .text-content ul {
            margin: 20px 0;
            padding-left: 20px;
        }

        .text-content li {
            margin-bottom: 10px;
            font-size: 1.1rem;
            color: #555;
        }

        .svg-container {
            width: 100%;
            height: 100%;
            display: flex;
            align-items: center;
            justify-content: center;
        }

        .svg-container svg {
            max-width: 100%;
            max-height: 100%;
        }

        /* Responsive Design */
        @media (max-width: 600px) {
            /* Use svg-column as viewport: 100vh tall */
            .snap-wrapper .content-container {
                height: auto;
                overflow: visible;
            }
            .content-container .two-column-layout {
                height: auto;
                flex-direction: column;
                gap: 20px;
            }
            .content-container .text-column { position: static; height: auto; }
            .content-container .text-section { height: auto; min-height: 100vh; margin-bottom: 20px; }

            .content-container .svg-column {
                position: relative;
                top: auto;
                height: 600px;
                max-height: 600px;
                overflow-y: auto;
                overscroll-behavior: contain; /* prevent scroll chaining */
                -webkit-overflow-scrolling: touch;
                width: 100%;
            }
            .content-container .svg-container {
                height: 650vh;               /* 3 pages */
                overscroll-behavior: contain; /* prevent scroll chaining */
            }
            .content-container .svg-container::-webkit-scrollbar { display: none; width:0; height:0; }
            .content-container .svg-container { scrollbar-width: none; -ms-overflow-style: none; }

            .text-content h1 { font-size: 2rem; }

            .text-content h2 {
                font-size: 1.5rem;
            }

            .text-content p {
                font-size: 1rem;
            }
            .svg-container svg{
                position: sticky;
                top: 0;
                height: 600px;
                filter: none;
            }

            /* Respect users who prefer reduced motion */
            @media (prefers-reduced-motion: reduce) {
                * {
                    animation-duration: 0.01ms !important;
                    animation-iteration-count: 1 !important;
                    transition-duration: 0.01ms !important;
                    scroll-behavior: auto !important;
                }
            }
        }
    </style>
</head>
